import React, { Component } from 'react';

class MobilMenu extends Component {

  render() {
    return (
      <div className='mobile-menu'>
        <ul>
          <li>About</li>
          <li>Projects</li>
          <li>Contact</li>
        </ul>
      </div>
    );
  }
}

export default MobilMenu;
